import React from 'react'
import adress from "./adress.png"
import HobbiesItems from "./HobbiesItems"

function Hobbies() {
  return (
    <div id="about-div">
      <h2>hobbies</h2>
      {HobbiesItems.map((item, index) => {
        return(
      <p key={item.index}><img src={item.icon} alt=""></img><span></span></p>
      )})}
    </div>
  )
}

export default Hobbies
